import { Component } from "inferno";
import { connect } from "inferno-redux";
import { addTodo, getTodos } from "./actions/todoActions";

class Todo extends Component {
  render() {
    return (
      <div>
        <h1>Todo</h1>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  todo: state.todo
});

export default connect(
  mapStateToProps,
  { getTodos }
)(Todo);
